(195, '195', NULL, 1, '2024-09-19 07:00:00', '2024-09-19 16:00:00', 1, 'AC_TEL', '2024-04-19 07:45:30', '2024-06-10 13:36:25', 14, 14, NULL, 2506, 38, 0, 14, NULL, 1, 0, 'default', 0, 15, NULL, 32400, 'PROSPECTION', '<span style=\"font-size:14px\"><strong>09/09/24 </strong>: Prospection qualit&eacute;<br />\r\n<strong>19/04/24&nbsp;</strong>: Mme Mazet n&#39;a pas le temps pour la doc - nous rappelera pour en discuter d&egrave;s que possible.<strong> Attendre jusqu&#39;&agrave; 30 Avril puis stopper relance.&nbsp;</strong></span><br />\r\n<br />\r\n<span style=\"font-size:15px\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11pt\"><span style=\"color:black\">... MULTIPLES APPELS DE PROSPECTION POUR RGPD ENTRE MARS ET AVRIL 2024.<br />\r\n<strong><span style=\"font-family:Calibri,sans-serif\">05/12/24 (Sophie) </span></strong><span style=\"font-family:Calibri,sans-serif\">: Rencontre avec Mme MAZET au salon FEHAP du 16/11 au 17/11/23.</span></span></span></span></span></span>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
