(198, '198', NULL, 1, '2024-05-28 09:00:00', '2024-05-28 09:00:00', 1, 'AC_TEL', '2024-04-19 10:11:18', '2024-05-23 09:31:26', 14, 14, NULL, 39, 9, 0, 12, NULL, 1, 0, 'default', 0, 100, NULL, NULL, 'PROSPECTION', '<strong>PROSPECT ACCENS ANGERS - attente de PAN + PIN pour chiffrage.&nbsp;<br />\r\n<br />\r\n<br />\r\n19/04/24 (EAR) :&nbsp;</strong>Mme GRANIER au t&eacute;l&eacute;phone :&nbsp;<br />\r\n- Personne r&eacute;f&eacute;rente du RGPD &eacute;tait rattach&eacute;e au service informatique avant externalisation du service par un sous traitant.<br />\r\n- RGPD + DPO internalis&eacute; en interne : projet d&#39;organiser les registres + AIPD d&#39;ici 2025 mais peur de la charge de travail.<br />\r\n- Mr SIONNEAU parlait avec un cabinet mais souhaite nous rencontrer suite au Club DPO pour &eacute;ventuel accompagnement RGPD &agrave; la demande du DG.&nbsp;<br />\r\nEnvoi d&#39;un mail &agrave; Mr SIONNEAU pour demande de rencontre &eacute;ventuel devis. Mme GRANIER en copie.<br />\r\n<br />\r\n<strong>24/04/24 (EAR + TMO) </strong>: Rappel pour avoir Mr Sionneau - RDV t&eacute;l&eacute;phonique vendredi 26 Avril &agrave; 11h00.<br />\r\n<br />\r\n<strong>25/04/2024 (EAR) :</strong> Mr SIONNEAU en cong&eacute; jusqu&#39;au Lundi 6 Mai. A rappeler &agrave; ce moment l&agrave;.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
