(250, '250', NULL, 1, '2024-05-06 14:29:00', '2024-05-06 15:29:00', 102, 'AC_DEVIS', '2024-05-06 14:30:42', '2024-05-07 14:54:10', 14, 14, NULL, 2548, 94, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'ENVOI DU DEVIS', '<strong>06/05/24</strong> : Envoi du devis par Sophie Limele &agrave; Mme Hennart.<br />\r\n<br />\r\n<strong>07/05/24 </strong>: Mme Hennart fait une pr&eacute;sentation de notre RDV + devis &agrave; sa direction : Mr Masurelle.<br />\r\n<br />\r\nAppel de Mme Hennart en apr&egrave;s-midi pour fixer RDV R2 avec Mr Masurelle (DG).&nbsp;<br />\r\nNous informe que le devis est tr&egrave;s raisonnable et convient &agrave; leurs attentes. Mr Masurelle veut fixer un RDV pour &eacute;changer sur le devis + &eacute;change de questions.<br />\r\n<span style=\"color:#e74c3c\">RDV fix&eacute; au 15/05/24</span>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
