(252, '252', NULL, 1, '2024-05-21 09:00:00', '2024-05-21 10:00:00', 1, 'AC_TEL', '2024-05-20 09:05:13', '2024-05-23 09:51:49', 14, 14, NULL, 2567, 117, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'PROSPECTION', '<strong>20/05/24&nbsp;(EMA) </strong>: Prise de contact avec Mr Parrenin sur LinkedIn qui nous indique rechercher un DPO + une conformit&eacute; au RGPD apr&egrave;s l&#39;&eacute;t&eacute; 2024. Nous demande des renseignements sur prestations et tarifs.&nbsp;<br />\r\nExplication rapide &agrave; l&#39;&eacute;crit des prestations + proposition mail de documentation cabinet + proposition de RDV en visio pour pr&eacute;sentation et devis.&nbsp;<br />\r\n<strong>21/05/24 (EMA) :</strong> RDV fix&eacute; le Jeudi 30 Mai &agrave; 14h00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
