(255, '255', NULL, 1, '2024-05-21 10:00:00', '2024-05-21 10:00:00', 102, 'AC_DEVIS', '2024-05-21 10:04:42', '2024-05-23 09:52:13', 14, 14, NULL, 2548, 94, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, NULL, 'RELANCE DEVIS', '<strong>21/05/24 (EMA) :&nbsp;</strong><br />\r\n<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Le rendez-vous du 15/05 s&rsquo;est en effet tr&egrave;s bien d&eacute;roul&eacute;.</span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Cependant, le service cellule des march&eacute;s publics demande 3 devis de prestataires diff&eacute;rents au minimum avant de prendre une d&eacute;cision.</span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Apr&egrave;s discussion avec Mr Masurelle (directeur g&eacute;n&eacute;ral), ils sont toujours tr&egrave;s int&eacute;ress&eacute;s par notre proposition mais souhaitent des modifications sur le devis.</span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Ils veulent donc refaire le devis propos&eacute; le 06/05 avec les modifications suivantes&nbsp;:</span></span>\r\n<ul>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Enlever la prestation DPO externalis&eacute;.</span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Descendre le nb de demi-journ&eacute;e de formation &agrave; 1.</span></span></li>\r\n</ul>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(256, '256', NULL, 1, '2024-09-16 14:02:00', '2024-09-16 15:02:00', 1, 'AC_TEL', '2024-05-21 14:02:44', '2024-07-15 09:48:21', 14, 12, NULL, 2568, NULL, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'PROSPECTION', '<strong>07/06/24 (TMO) : </strong>Standard - Rappeler dans l&#39;apr&egrave;s-midi -<br />\r\nDirectrice pas disponible mais me dit qu&#39;elle n&#39;est pas int&eacute;r&eacute;ss&eacute; pour une mise en comformit&eacute; pour l&#39;instant', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(257, '257', NULL, 1, '2024-05-21 14:00:00', '2024-05-21 15:00:00', 5, 'AC_RDV', '2024-05-21 15:01:19', '2024-05-21 15:03:09', 14, 14, NULL, 2569, 118, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'RDV QUALITE', '<strong>21/05/24 (EMA + PAN) :</strong> RDV pour pr&eacute;sicions sur prestation qualit&eacute; avec Mr Mischler.<br />\r\n<br />\r\nDevis pour <span style=\"color:#c0392b\">Ehpad Bodin Grandmaison + Magnolia</span> (&eacute;tablissements en attente d&#39;accord de Magnolia)<br />\r\nViennent de d&eacute;buter la qualit&eacute; mais pas le temps pour travail &agrave; plein temps sur la qualit&eacute; = recherche d&#39;un<span style=\"color:#c0392b\"> salari&eacute; pour la qualit&eacute; </span>actuellement.<br />\r\nEvaluation pr&eacute;vu&eacute; pour le <span style=\"color:#c0392b\">dernier trimestre 2025.</span><br />\r\n<br />\r\nMr Mischler tr&egrave;s int&eacute;ress&eacute; par les <span style=\"color:#c0392b\">&eacute;valuations en blanc</span><br />\r\nPoss&egrave;de d&eacute;j&agrave; un logiciel (<span style=\"color:#c0392b\">Net Soins</span> = pas besoin de MS mais compris dans le packaging)<br />\r\n<br />\r\nDemande d&#39;envoi d&#39;offre tarifaire pour avoir une id&eacute;e car ind&eacute;cis pour le moment.<br />\r\n<br />\r\nDevis &agrave; envoyer avant d&eacute;but Juin 2024.<br />\r\nPr&eacute;voir de relancer PAN pour :<br />\r\n<br />\r\n- Discussion tarif avec PIN<br />\r\n- Elaboration du devis<br />\r\n- Envoi du devis&nbsp;<br />\r\n<br />\r\n<u><strong>Proposer une pr&eacute;sentation apr&egrave;s l&#39;envoi du devis&nbsp;</strong></u><br />\r\n<br />\r\n<strong>EMA en charge du dossier, suivi et relance.</strong>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(258, '258', NULL, 1, '2025-01-09 13:00:00', '2025-01-09 14:00:00', 1, 'AC_TEL', '2024-05-23 07:24:13', '2024-06-20 13:14:22', 14, 14, NULL, 2570, NULL, 0, 14, NULL, 1, 0, 'default', 0, 50, NULL, 3600, 'PROSPECTION', '<strong>22/05/24 (EMA) : </strong>Appel pour d&eacute;marche RGPD car DAC VAR OUEST client. Etablissement ferm&eacute; ce jour.<br />\r\n<strong>23/05/24 (EMA) </strong>: Mme Aeimerton Sandra (Qualiticienne) : Travail RGPD entreprit en interne ( &eacute;tude du traitement des donn&eacute;es / recherche &agrave; former un DPO en interne / audit ...) Pense &agrave; nous demander un devis pour une mise en conformit&eacute; - veulent d&#39;abord utiliser leurs ressources en interne avant de passer par un prestataire mais probablement besoin d&#39;assistance sur certains sujet. Apr&egrave;s discussion avec Mme Aeimerton, interess&eacute;e par nos services sauf les formations sensibilisation. A prit nos coordonn&eacute;es et mon nom - Me rappelera pour devis apr&egrave;s discussion avec la direction.&nbsp;<br />\r\n<strong>20/06/24 (EMA) </strong>: Mme Aeimerton Sandra : appel pour retour sur le webinaire + Point sur avancement RGPD : Forme en interne une personne pour &ecirc;tre DPO, s&#39;appuie sur diff&eacute;rents services internes pour la conformit&eacute; du logiciel m&eacute;tier. Evoque de faire appel &agrave; nous sur un moyen terme lorsque les ressources internes seront &eacute;puis&eacute;es. Accepte le webinaire du 04/07.<br />\r\nA appeler en Janvier', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(259, '259', NULL, 1, '2024-07-18 12:00:00', '2024-07-18 13:00:00', 1, 'AC_TEL', '2024-05-23 07:28:59', '2024-07-16 13:10:10', 14, 12, NULL, 2571, 119, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>22/05/24 (EMA) :</strong> Mme Carle pas disponible l&#39;apr&egrave;s-midi. Standard nous donne les coordonn&eacute;es (Cf. Contact). Appel sur t&eacute;l de Mme Carle : Laisse une message vocal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(260, '260', NULL, 1, '2024-05-30 07:30:00', '2024-05-30 08:30:00', 1, 'AC_TEL', '2024-05-23 07:31:20', '2024-05-23 14:27:03', 14, 14, NULL, 2572, NULL, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'PROSPECTION', '<strong>22/05/24 (EMA) </strong>: Pas de r&eacute;ponse au Standard mais &eacute;tablissement ouvert. A rappeler pour d&eacute;marche RGPD', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(261, '261', NULL, 1, '2024-10-21 07:30:00', '2024-10-21 08:30:00', 1, 'AC_TEL', '2024-05-23 07:35:17', '2024-06-03 13:14:24', 14, 14, NULL, 2573, NULL, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'PROSPECTION', '<strong>22/05/24 (EMA) </strong>: Standard - Personne du RGPD pour le moment : demander Gaylord (en cong&eacute; jusqu&#39;&agrave; d&eacute;but Juin)<br />\r\n<strong>03/06/24 (EMA) </strong>: Gaylord ( ATTENTION IL S&#39;AGIT DU PRENOM ) : Lancement r&eacute;cent de la conformit&eacute; au sein de l&#39;&eacute;tablissement - Vient d&#39;&ecirc;tre nomm&eacute; DPO. Pas de besoin pour le moment - Nous informe que le DAC13Sud est d&eacute;j&agrave; en conformit&eacute; RGPD car formation DPO d&#39;un salari&eacute;.&nbsp;<br />\r\nNe savait pas que Mr Claquin avait sign&eacute; chez nous. Garde en t&ecirc;te notre cabinet en cas de difficult&eacute; pour &eacute;ventuel accompagnement. Nous apprends qu&#39;une r&eacute;union des directeurs DAC PACA &agrave; lieu le 04/06/24 (possibilit&eacute; de discussion mutualisation prestation).&nbsp;<br />\r\n<br />\r\nRelancer en octobre pour d&eacute;marche Qualit&eacute;', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(262, '262', NULL, 1, '2024-05-29 07:00:00', '2024-05-29 08:00:00', 101, 'AC_ENVOI_DOC', '2024-05-23 07:38:34', '2024-05-29 12:14:15', 14, 14, NULL, 2574, NULL, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'PROSPECTION', '<strong>22/05/24 (EMA) : </strong>Aucune r&eacute;ponse - renvoi sur messagerie de la standardiste : Message vocal laiss&eacute;<br />\r\n<strong>29/05/24 (EMA) :</strong> Standard : ne s&#39;occupe pas de la partie RGPD - me confie les coordonn&eacute;es de la directrice (Mme Gregorio) t&eacute;l + mail (Cf. contact)<br />\r\n<em><strong>Appel sur ligne directe de Mme Gregorio </strong></em>: Message vocal&nbsp;', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(263, '263', NULL, 1, '2024-07-18 07:40:00', '2024-07-18 08:40:00', 1, 'AC_TEL', '2024-05-23 07:42:14', '2024-07-15 09:25:13', 14, 12, NULL, 2575, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>22/05/24</strong> : Appel pour d&eacute;marche RGPD - Mr le directeur : Nous informe ne pas comprendre le partenariat avec DAC VAR OUEST.<br />\r\nMr Claquin est directeur de la FACS SUD de la r&eacute;gion. La d&eacute;marche RGPD sera bientot mutualis&eacute; et pense que le r&eacute;seau (FACS) s&#39;occupe d&eacute;j&agrave; de la conformit&eacute; des DAC PACA.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(264, '264', NULL, 1, '2024-07-22 07:45:00', '2024-07-22 08:45:00', 101, 'AC_ENVOI_DOC', '2024-05-23 07:46:20', '2024-07-11 08:29:46', 14, 14, NULL, 2576, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>22/05/24 (EMA) :</strong> Standard : Ne sait pas vers qui me rediriger - demande d&#39;envoyer un mail au standard &agrave; l&#39;attention de la direction pour expliquer notre projet.<br />\r\n<strong>24/05/24 (EMA) </strong>: Mail de documentation envoyer avec demande de RDV.<br />\r\n<strong>11/07/24 (EMA) </strong>: Standard - La personne en charge de la qualit&eacute; + direction sont en cong&eacute;s depuis + d&#39;un mois. Mail sans doute pas encore trait&eacute;. Me conseille de refaire un mail apr&egrave;s la semaine du 17/07/24 pour qu&#39;il soit en haut de la liste &agrave; leur retour.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(265, '265', NULL, 1, '2024-08-19 07:00:00', '2024-08-19 08:00:00', 101, 'AC_ENVOI_DOC', '2024-05-23 07:52:04', '2024-07-17 13:15:59', 14, 12, NULL, 2577, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>22/05/24 (EMA) </strong>: Responsable RGPD pas pr&eacute;sent avant la semaine prochaine car en formation. Rappeler en fin de semaine.<br />\r\n<strong>06/06/24 (TMO) :</strong> Standard - Mme DUPONT (R&eacute;f&eacute;rente i parcours - charge du RGPD) pas dispo, prend coordonn&eacute;e nom + pr&eacute;nom et lui fait un mail pour qu&#39;elle nous recontacte le plus tot possible.<br />\r\n<strong>11/06/24 (EMA) :</strong> Standard - M&#39;informe qu&#39;elle s&#39;est tromp&eacute; le 06/6, il s&#39;agit de Mme Segall pour le RGPD - me confirme que l&#39;on peut lui transmettre un mail car Mme Segall est DG et est souvent en d&eacute;placement;<br />\r\n(EMA) Mail envoy&eacute; le 11/06/24<br />\r\n<strong>11/07/24 (EMA) </strong>: Standard - Madame Segall en cong&eacute;, revient la semaine du 15/07', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(266, '266', NULL, 1, '2024-08-20 07:54:00', '2024-08-20 08:54:00', 1, 'AC_TEL', '2024-05-23 07:56:02', '2024-07-16 13:08:17', 14, 12, NULL, 2578, 123, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>22/05/24 (EMA) </strong>: Standard : Mr David (adjoint de direction) serait le plus &agrave; m&ecirc;me de s&#39;occuper du RGPD. En r&eacute;union t&eacute;l&eacute;phonique. Le standard nous donne ses coordonn&eacute;es (Cf.Contact). Demande d&#39;envoyer notre projet par mail.<br />\r\n<strong>06/06/24 (TMO) :</strong> Standard ligne occup&eacute;e<br />\r\n<strong>09/07/24 (TMO) : </strong>Mail envoy&eacute; + appel&eacute; pour confirmer adresse mail.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(267, '267', NULL, 1, '2024-06-21 08:01:00', '2024-06-21 09:01:00', 1, 'AC_TEL', '2024-05-23 08:03:19', '2024-06-21 12:51:39', 14, 12, NULL, 2579, 124, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'PROSPECTION', 'PROSPECT EMA<br />\r\n<strong>22/05/24 (EMA) :</strong> Standard - personne charg&eacute;e du RGPD pas pr&eacute;sente ce jour. Rappeler le 23/05 et demander Mme Marante (coordinatrice territoriale).<br />\r\n<strong>07/06/24 (TMO) : </strong>Standard - Me passe le num&eacute;ro professionnel de Mme Marante (car il est en t&eacute;l&eacute;travail) : <span style=\"color:#3498db\"><strong>06 38 12 21 48 </strong></span>- Message vocal laiss&eacute;<br />\r\nSuite &agrave; un mail, Mme Marante pas int&eacute;r&eacute;ss&eacute;', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(268, '268', NULL, 1, '2024-09-19 08:14:00', '2024-09-19 09:14:00', 1, 'AC_TEL', '2024-05-23 08:14:55', '2024-06-05 12:54:37', 14, 14, NULL, 2580, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>22/05/24 (EMA) </strong>: Pas de r&eacute;ponse au standard - r&eacute;essayer ulterieurement<br />\r\n<strong>28/05/24 (EMA)</strong> : Standard : La personne charg&eacute;e du RGPD (ELLE) est en r&eacute;union - Standard prend nos coordonn&eacute;es et lui demande de nous rappeler.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(269, '269', NULL, 1, '2024-08-20 07:30:00', '2024-08-20 08:30:00', 1, 'AC_TEL', '2024-05-23 08:19:22', '2024-07-17 08:05:31', 14, 12, NULL, 2581, 128, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>22/05/24 (EMA) </strong>: Standard - Personne charg&eacute;e du RGPD absente jusqu&#39;au Lundi 27 Mai - convenu ensemble de rappeler le 27/05 &agrave; 9h30.<br />\r\n<strong>24/05/24 (EMA)</strong> : Standard - Mr Lecomte pas disponible car en r&eacute;union la matin&eacute;e - reprend mes coordonn&eacute;es et les transmets + le message ( Volont&eacute; de mutualisation du RGPD sur le territoire pour l&#39;ensemble des DAC - recherche de prestataire)<br />\r\n<strong>27/05/24 (EMA) :</strong> Standard (diff&eacute;rente du 24/05) Mr Lecomte est en rdv exterieur : passe le message et lui demande de nous rappeler.<br />\r\n<strong>28/05/24 (EMA) </strong>: Standard : Mr Lecomte entre en r&eacute;union mais a bien re&ccedil;u nos mails + appels - Nous recontacte d&egrave;s que possible.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(270, '270', NULL, 1, '2024-09-17 08:23:00', '2024-09-17 09:23:00', 1, 'AC_TEL', '2024-05-23 08:24:52', '2024-06-12 12:08:17', 14, 14, NULL, 2582, 130, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>22/05/24 (EMA) </strong>: Standard - ne peut pas me passer la personne en charge du RGPD (ne sait pas qui s&#39;en occupe). Me demande de transmettre un mail au standard pour la direction. Nous rappelera si un besoin.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(271, '271', NULL, 1, '2024-08-20 08:00:00', '2024-08-20 08:00:00', 1, 'AC_TEL', '2024-05-23 08:29:12', '2024-07-16 13:08:54', 14, 12, NULL, 2583, 134, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, NULL, 'PROSPECTION', '<strong>22/05/24 (EMA) :</strong> Standard - Personne charg&eacute;e du RGPD est en arret ne sait pas quand elle reviendra. Demande d&#39;envoi de mail avec notre projet &agrave; l&#39;attention de Mme Andrieux (coordinatrice territoriale).<br />\r\n<strong>20/06/24 (EMA) </strong>: Standard - d&eacute;j&agrave; en ligne, pas de r&eacute;ponse, &agrave; relancer', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(272, '272', NULL, 1, '2024-07-18 09:58:00', '2024-07-18 10:58:00', 50, 'AC_OTH', '2024-05-24 10:00:44', '2024-07-17 08:25:57', 14, 12, NULL, 2584, NULL, 0, 14, NULL, 1, 0, 'default', 0, 0, NULL, 3600, 'PROSPECTION', '<strong>10/06/24 (EMA) :</strong> Standard ne r&eacute;pond pas - retenter le 11/06<br />\r\n<strong>11/06/24 (EMA)</strong> : Standard pas de r&eacute;ponse - tourne dans le vide - MODIFICATION TELEPHONE FAITE SUR DOLIBARR<br />\r\n12/06/24 (EMA) : Toujours pas de r&eacute;ponse - tenter de trouver un autre t&eacute;l&eacute;phone', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL);
