(273, '273', NULL, 1, '2024-06-21 10:09:00', '2024-06-21 11:09:00', 1, 'AC_TEL', '2024-05-24 10:09:58', '2024-07-09 10:13:18', 14, 12, NULL, 2585, 137, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'PROSPECTION', '<strong>06/06/24 (TMO) :</strong> Ligne occup&eacute;e<br />\r\n<strong>07/06/24 (TMO) :</strong> Standard - R&eacute;f&eacute;rent RGPD absente, rappeler la semaine pro et demander le DRH (r&eacute;f&eacute;rent RGPD) - Standard agr&eacute;able et compr&eacute;hensif<br />\r\n<strong>10/06/24 (EMA) </strong>: Standard - Pas de r&eacute;ponse r&eacute;essayer le 11/06<br />\r\n<strong>11/06/24 (EMA) :</strong> Standard - Pas de r&eacute;ponse - &quot;Nous ne sommes pas en mesure de vous r&eacute;pondre pour le moment&quot; mais bien sur les bonnes horaires<br />\r\n<strong>12/06/24 (EMA) </strong>: Standard - Pas de r&eacute;ponse - tourne dans le vide - tenter de rappeler le vendredi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
