(275, '275', NULL, 1, '2024-09-09 10:13:00', '2024-09-09 11:13:00', 1, 'AC_TEL', '2024-05-24 10:13:53', '2024-06-19 09:31:41', 14, 12, NULL, 2586, NULL, 0, 14, NULL, 1, 0, 'default', 0, 0, NULL, 3600, 'PROSPECTION', '<strong>05/06/24 (TMO) : </strong>Standard - Voit avec ses coll&egrave;gues, longue mise en attente - Demande si on veut la direction, encore une longue mise en attente - Me dit qu&#39;elle n&#39;est pas dispo, envoy&eacute; un mail &agrave; : <span style=\"color:#2980b9\"><strong>accueil@adapei72.asso.fr</strong></span> &agrave; l&#39;intention de Mme Mauguin - Reformuler la demande car avait l&#39;air un peu perdu<br />\r\n<strong>DOC RGPD ENVOYE LE 05/06/24</strong><br />\r\n<strong>07/06/24 (TMO) : </strong>Standard - Ne connait pas de Mme Mauguin, ne trouve pas mon mail envoy&eacute; le 05/06/24 mais en &agrave; d&#39;autres concernant nos article, invitation au Webinaire et certains datant de 2019.<br />\r\n<strong>10/06/24 (EMA) </strong>: Standard - Pas de r&eacute;ponse<br />\r\n<strong>11/06/24 (EMA) : </strong>Standard <strong>-&nbsp;</strong>Mail bien re&ccedil;u et transmis &agrave; la direction - attendre retour de leur part sinon pas int&eacute;ress&eacute;', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(276, '276', NULL, 1, '2024-05-24 07:45:00', '2024-05-24 08:45:00', 101, 'AC_ENVOI_DOC', '2024-05-24 10:16:59', '2024-05-24 10:17:27', 14, 14, NULL, 2576, NULL, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'DOC RGPD', '<strong>22/05/24 (EMA) :</strong> Standard : Ne sait pas vers qui me rediriger - demande d&#39;envoyer un mail au standard &agrave; l&#39;attention de la direction pour expliquer notre projet.<br />\r\n<strong>24/05/24 (EMA) </strong>: Mail de documentation envoyer avec demande de RDV.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(277, '277', NULL, 1, '2024-06-14 10:17:00', '2024-06-14 11:17:00', 101, 'AC_ENVOI_DOC', '2024-05-24 10:17:33', '2024-06-14 10:26:12', 14, 12, NULL, 2587, NULL, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'DOC RGPD', '<strong>05/06/24 (TMO) : </strong>Standard - Direction en r&eacute;union CODIR, rappeler le 06/06/24, sa coll&egrave;gue nous redirigera vers la bonne personne - Standard agr&eacute;able<br />\r\n<strong>07/06/24 (TMO) :</strong> Standard - Peu de personne aujourd&#39;hui, nous demande de rappeler <span style=\"color:#e74c3c\"><strong>Lundi 10 Juin</strong></span> car l&#39;assistante de direction filtre les appels et sera plus &agrave; m&ecirc;me de nous passer la bonne personne.<br />\r\n<strong>10/06/24 (EMA) :</strong> Standard - Personne charg&eacute;e du RGPD (ELLE - Justine) n&#39;est pas pr&eacute;sente sur site aujourd&#39;hui. Conseille de rappeler en matin&eacute;e.<br />\r\n<strong>14/06/24 (TMO) : </strong>Standard pr&eacute;ss&eacute;, me demande d&#39;envoyer un email pour toute demande &quot;commercial&quot; : <span style=\"color:#3498db\"><strong>siege.social@adapei41.org</strong></span><br />\r\n<span style=\"color:#e74c3c\"><strong>Ne pas relancer apr&egrave;s envoie - ENVOYE LE 14/06/24 (TMO)</strong></span>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
