(291, '291', NULL, 1, '2024-07-08 15:25:00', '2024-07-08 16:25:00', 1, 'AC_TEL', '2024-05-27 15:27:16', '2024-07-08 12:34:45', 14, 12, NULL, 2596, 145, 0, 14, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'PROSPECTION', '<strong>27/05/24 (EMA) :</strong> Standard : Mme Labierge (secr&eacute;taire de direction) pourra nous informer sur l&#39;avanc&eacute;e du RGPD mais a priori d&eacute;j&agrave; en cours car le standard nous informe d&#39;une formation RGPD pr&eacute;vue le 29/05/24.<br />\r\n<strong>28/05/24 (EMA)</strong> : Mme Labierge (ligne diecte) - Pas de r&eacute;ponse - tenter plus tard au standard ou via ligne directe.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(292, '292', NULL, 1, '2025-01-06 16:28:00', '2025-01-06 17:28:00', 1, 'AC_TEL', '2024-05-27 15:30:08', '2024-06-05 08:43:58', 14, 12, NULL, 2597, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>27/05/24 (EMA)</strong> : standard nous informe ne pas avoir de charg&eacute; pour le RGPD car chacun participe. Pour le moment aucune conformit&eacute; mais travaille avec AGEVAL (qualit&eacute;) et r&eacute;fl&eacute;xion pour un DUI.<br />\r\nEn septembre ce ne sera pas avanc&eacute;e. Proposition de rappel en Janvier pour point sur l&#39;avanc&eacute;e.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(293, '293', NULL, 1, '2024-11-12 14:04:00', '2024-11-12 15:04:00', 1, 'AC_TEL', '2024-05-28 13:11:01', '2024-05-28 13:11:01', 14, NULL, NULL, 2547, NULL, 0, 14, NULL, 1, 0, 'default', 0, 30, '', 3600, 'PROJET DE MISE EN CONFORMITE', '<strong>28/05/24 (EMA) </strong>: Mr St Martin :&nbsp;<br />\r\n<br />\r\nLe RGPD est en d&eacute;but de projet et &agrave; peine commenc&eacute;.&nbsp;<br />\r\nMise en place de proc&eacute;dures d&#39; auto-&eacute;valuations ( &eacute;valuation pr&eacute;vue en 1er trimestre 2027)<br />\r\nMise en place du programme ESMS num&eacute;rique ( lancement de la phase pilote pr&eacute;vue en juillet)<br />\r\nActuellement un prestataire pour un DSI : en externe pour avancer sur la s&eacute;curit&eacute; des donn&eacute;es num&eacute;riques)&nbsp;<br />\r\n+ Transition sur les outils internes ( Papier = num&eacute;rique / changement de MDP...)<br />\r\nNous suit sur LINKEDIN et suit attentivement nos documents (Blog...).&nbsp;<br />\r\n<br />\r\nAvons convenu de se rappeler en Novembre pour faire un point sur la p&eacute;riode de transition et &eacute;voquer ensemble un devis ( Mr St Martin souhaiterait le faire en Mai mais trop de chantier en cours pour en parler &agrave; la direction - mieux vaut attendre en novembre).', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(294, '294', NULL, 1, '2024-08-19 14:51:00', '2024-08-19 15:51:00', 1, 'AC_TEL', '2024-05-28 14:53:13', '2024-07-17 13:21:47', 14, 12, NULL, 2598, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>28/05/24 (EMA) </strong>: Standard : prend nos coordonn&eacute;es et se renseigne sur la personne en charge du RGPD - en r&eacute;f&egrave;re &agrave; la Cheffe de service (en r&eacute;union) - nous recontactera<br />\r\n<strong>08/07/24 (TMO) :</strong> Standard - Me dit qu&#39;ils sont plusieurs &agrave; la contacter chaque semaine, demande d&#39;envoyer un email &agrave; : <span style=\"color:#3498db\"><strong>contact@appuisante14.org.</strong></span><br />\r\n<span style=\"color:#e74c3c\"><strong>MAIL ENVOYE LE 08/07/24 (TMO)</strong></span><br />\r\nA relancer ?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(295, '295', NULL, 1, '2024-08-19 14:54:00', '2024-08-19 15:54:00', 1, 'AC_TEL', '2024-05-28 14:55:36', '2024-07-17 13:12:19', 14, 12, NULL, 2599, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>28/05/24 (EMA) </strong>: Standard : charg&eacute;e du RGPD (ELLE) pas &agrave; l&#39;&eacute;tablissement ce jour. Prend nos coordonn&eacute;es<br />\r\n<strong>08/07/24 (TMO) : </strong>Messagerie laiss&eacute; avec nos coordonn&eacute;.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
