(343, '343', NULL, 1, '2025-01-06 16:11:00', '2025-01-06 17:11:00', 50, 'AC_OTH', '2024-06-12 15:15:54', '2024-06-20 07:33:46', 14, 14, NULL, 2624, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'REDIFFUSION WEBINAIRE 13/06', 'PROSPECT EMA<br />\r\n<strong>12/06/24 (EMA) : </strong>Mme Marion - coordinatrice / infirmi&egrave;re / DPO : Met en place des formulaires, autorisations (...) est en cours de r&eacute;flexion pour une logiciel adapt&eacute; au DUI et n&#39;a pas encore commenc&eacute; le SEGUR num&eacute;rique mais le sera d&#39;ici fin 2024. Il s&#39;agit d&#39;un accueil de jour et d&#39;un Ehpad. N&#39;envisage pas d&#39;accompagnement pour le moment car veut d&#39;abord identifier les faiblesses et besoins sp&eacute;cifiques avant. PHASE DE TRANSITION. Tr&egrave;s int&eacute;ress&eacute;e par le Webinaire du 13/06 mais pourra pas y assister. Nous demande de lui transmettre la rediffusion d&egrave;s que possible.&nbsp;<br />\r\n<span style=\"color:#e74c3c\">A recontacter en Janvier pour point sur l&#39;&eacute;volution de la d&eacute;marche.</span>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
