(387, '387', NULL, 1, '2024-08-20 10:16:00', '2024-08-20 11:16:00', 1, 'AC_TEL', '2024-06-19 10:21:28', '2024-07-16 13:02:55', 12, 12, NULL, 2656, NULL, 0, 12, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', 'FINESS 28<br />\r\n<strong>19/06/24 (TMO) : Directrice :</strong> Me dit que pour eux, ils ont des formulaires &agrave; faire remplir &agrave; l&#39;admission des usagers pour archivage des donn&eacute;es ect, qu&#39;ils ont un logiciel interne avec acc&egrave;s limit&eacute;.<br />\r\nMais tout se passe au si&egrave;ge donc ne sait pas si ils sont bien conforme, me dit qu&#39;elle va se renseigner pour &ecirc;tre sur et donc ne peut pas me donner une r&eacute;ponse maintenant - A pris mon nom, num&eacute;ro, site internet (s&#39;est renseigner dessus au tel) - Me dit que malheureusement elle ne peux pas passer directement nos coordonn&eacute;es au si&egrave;ge car on est pas agr&eacute;e par l&#39;Etat donc nous dira non directement mais elle se renseigne quand m&ecirc;me de son cot&eacute; et revien vers nous.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(388, '388', NULL, 1, '2024-08-20 13:19:00', '2024-08-20 14:19:00', 1, 'AC_TEL', '2024-06-19 13:22:53', '2024-07-16 13:02:40', 12, 12, NULL, 2657, NULL, 0, 12, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', 'Webianire 13 Juin 2024&nbsp;<br />\r\n<strong>19/06/24 (TMO) : Mr Galindo</strong> - Satisfait du Webinaire - niveau RGPD il est fait en interne et avance petit &agrave; petit, il est conscient de la charge de travail - DPO avec la ville d&#39;antibes bien qu&#39;il ne soit pas rattach&eacute; a elle (ind&eacute;pendant) - Pas lui qui se charge du RGPD mais Mme Marie Joffroy - Souhaite recevoir le lien d&#39;inscription du Webinaire prochain.<br />\r\n<strong>Mme Marie JOFFROY :</strong> A trouv&eacute; le Webinaire tr&egrave;s bien mais assez court mais d&#39;un cot&eacute; c&#39;est bien, a appris quelques truc.<br />\r\n<span style=\"color:#e74c3c\"><strong>Niveau RGPD : </strong></span>Que 1 ans qu&#39;elle s&#39;occupe du RGPD en interne, charge de travail assez cons&eacute;quente surtout qu&#39;elle g&egrave;re seule donc fait par ordre de &quot;priorit&eacute;&quot; - DPO plus mutualis&eacute; depuis 06 Juin 2024, pas d&#39;autre nomm&eacute; - RGPD en interne mais pense que la mairie veut qu&#39;il se fasse par un prestataire (a voir d&#39;apr&egrave;s elle) pour l&#39;instant elle &quot;attend&quot; et s&#39;informe le plus possible sur le RGPD. -&nbsp;Souhaite recevoir le lien d&#39;inscription du Webinaire prochain (ENVOYE)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
