(417, '417', NULL, 1, '2024-08-20 14:45:00', '2024-08-20 15:45:00', 1, 'AC_TEL', '2024-07-08 14:46:34', '2024-07-17 07:40:55', 12, 12, NULL, 2687, NULL, 0, 12, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', '<strong>08/07/24 (TMO) : </strong>Standard indisponible, message vocal laiss&eacute; + mail envoy&eacute;.<br />\r\n<strong>10/07/24 (TMO) : </strong>Standard - A compris le sens Commercial de ma demande - Mail bien redistribu&eacute; vers la direction, lui repasse le message et me fait comprendre que cela peut mettre du temps - Sans aucun soucis,<br />\r\nAttendre un peu avant de relancer.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(418, '418', NULL, 1, '2024-07-11 14:52:00', '2024-07-11 15:52:00', 1, 'AC_TEL', '2024-07-08 14:53:18', '2024-07-11 11:31:50', 12, 12, NULL, 2688, NULL, 0, 12, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'PROSPECTION', '<strong>08/07/24 (TMO) :</strong> Sur messagerie, &agrave; rappeler.<br />\r\n<strong>10/07/24 (TMO) :</strong> Standard - Ne voit pas en quoi consiste le RGPD - Je lui est dit Donn&eacute;es Salari&eacute;s/Usagers, Formations... - Je lui est dit qu&#39;on &eacute;tait en contacte avec d&#39;autres DAC de Normandie - Prend mes coordonn&eacute;es et en parle &agrave; sa direction (Ne semblait pas conforme) - Standard agr&eacute;able et compr&eacute;hensif.<br />\r\n<strong>11/07/24 (TMO) :</strong> Retour mail - Directrice pas int&eacute;r&eacute;ss&eacute;e par nos service.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(419, '419', NULL, 1, '2024-08-22 14:00:00', '2024-08-22 14:00:00', 1, 'AC_TEL', '2024-07-09 14:54:43', '2024-07-17 13:15:06', 14, 12, NULL, 2689, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, NULL, 'PROSPECTION', 'PROSPECT EMA<br />\r\n<strong>09/07/24 (EMA) </strong>: Pas de r&eacute;ponse au standard- rappeler le 10/07', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(420, '420', NULL, 1, '2024-07-22 14:56:00', '2024-07-22 15:56:00', 1, 'AC_TEL', '2024-07-09 14:57:13', '2024-07-17 14:20:44', 14, 12, NULL, 2690, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', 'PROSPECT EMA<br />\r\n<strong>09/07/24 (EMA) </strong>: Standard - La personne charg&eacute;e du RGPD ( ELLE) est absente cette apr&egrave;s-midi. Nous demande de rappeler le 17/07/24', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(421, '421', NULL, 1, '2024-12-02 15:58:00', '2024-12-02 16:58:00', 1, 'AC_TEL', '2024-07-09 15:00:27', '2024-07-09 15:00:27', 14, NULL, NULL, 2691, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, '', 3600, 'PROSPECTION', 'PROSPECT EMA<br />\r\n<strong>09/07/24 (EMA) </strong>: Standard - La personne en charge du RGPD (responsable qualit&eacute;) est en cong&eacute; maternit&eacute;. Sera remplac&eacute;e en fin d&#39;ann&eacute;e. Nous invite &agrave; rappeler en d&eacute;cembre.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(422, '422', NULL, 1, '2024-07-18 15:01:00', '2024-07-18 16:01:00', 1, 'AC_TEL', '2024-07-09 15:03:02', '2024-07-15 08:44:23', 14, 12, NULL, 2692, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', 'PROSPECT EMA<br />\r\n<strong>09/07/24 (EMA)</strong> : Standard - nous invite &agrave; envoyer un mail &agrave; Mr Tomasi (?) &agrave; : directeur@apij49.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(423, '423', NULL, 1, '2024-08-22 15:22:00', '2024-08-22 16:22:00', 1, 'AC_TEL', '2024-07-09 15:23:55', '2024-07-16 13:10:45', 14, 12, NULL, 2693, NULL, 0, 14, NULL, 1, 0, 'default', 0, 15, NULL, 3600, 'PROSPECTION', 'PROSPECT EMA<br />\r\n<strong>09/07/24 (EMA) :&nbsp;</strong>Pas de r&eacute;ponse - envoi de mail &agrave; l&#39;intention de Madame Nathalie FERRIER.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(424, '424', NULL, 1, '2024-08-21 15:25:00', '2024-08-21 16:25:00', 1, 'AC_TEL', '2024-07-09 15:26:38', '2024-07-17 08:27:44', 14, 12, NULL, 2694, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', 'PROSPECT EMA<br />\r\n<strong>09/07/24 (EMA) : </strong>Standard - Ne sait pas qui s&#39;occupe du RGPD - Me propose d&#39;envoyer un mail au standard &agrave; l&#39;intention de la direction pour le transmettre.<br />\r\n(EMA) Mail envoy&eacute; le 09/07/24', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(425, '425', NULL, 1, '2024-08-22 15:28:00', '2024-08-22 16:28:00', 1, 'AC_TEL', '2024-07-09 15:29:51', '2024-07-17 12:38:53', 14, 12, NULL, 2695, NULL, 0, 14, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', 'PROSPECT EMA&nbsp;<br />\r\n<strong>09/07/24 (EMA) :</strong> Standard de la direction g&eacute;n&eacute;rale&nbsp; (02 41 80 77 01) - Ne sait pas qui est en charge du RGPD - me demande de lui envoyer un mail &agrave; : dg.secretariat@ch-cesame-angers.fr', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(426, '426', NULL, 1, '2024-09-05 14:38:00', '2024-09-05 15:38:00', 5, 'AC_RDV', '2024-07-22 14:52:05', '2024-07-22 15:17:44', 12, 12, NULL, 2554, 172, 0, 12, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'PROSPECTION', 'PROSPECTION LINKEDIN (TMO)<br />\r\n<br />\r\n<strong>22/07/24 (TMO) : </strong>Mr BONNIN, nous fait comprendre que son accompagnement RGPD/DPO ne lui convient pas -<br />\r\n<strong>DPO :&nbsp;</strong>Ma&icirc;tre De Segonzac - Virtualegis AARPI, Avocat Associ&eacute; E.I. - Depuis 2 ans.<br />\r\nIl souhaite se recentrer sur son coeur de m&eacute;tier, son prestataire actuel l&#39;en &eacute;loigne.<br />\r\nNous invite &agrave; contacter Mr Anizan - Directeur G&eacute;n&eacute;ral Adjoint en charge du dossier RGPD/DPO.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(427, '427', NULL, 1, '2024-07-23 12:20:00', '2024-07-23 13:20:00', 5, 'AC_RDV', '2024-07-23 12:31:39', '2024-07-23 12:32:59', 12, 12, NULL, 2591, 175, 0, 12, NULL, 1, 0, 'default', 0, 10, NULL, 3600, 'Compte Rendu 23/07/24', 'RDV T&eacute;l&eacute;phonique (TMO + PAN)<br />\r\n- 80 &eacute;tablissements<br />\r\n- 1 800 salari&eacute;s<br />\r\n- 3 000 personnes accompagn&eacute;s<br />\r\n<strong>Mme Tual</strong> est DPO, met &agrave; jour le registre des traitements une fois chaque ann&eacute;e - Pas de PIA mis en place - Un seul Responsable qualit&eacute; pour les 80 &eacute;tablissements - Pas un gros budjet.<br />\r\nFait remonter toutes les informations concernant notre accompagnement, revient vers nous si jamais il y a une possibilit&eacute; de planifier un RDV en visio (Mme Tual + Responsable Qualit&eacute;)<br />\r\nSouhaite recevoir le descriptif DPO', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(428, '428', NULL, 1, '2024-07-24 08:06:00', '2024-07-24 09:06:00', 5, 'AC_RDV', '2024-07-24 08:11:30', '2024-07-24 08:11:39', 12, 12, NULL, 2702, 176, 0, 12, NULL, 1, 0, 'default', 0, 100, NULL, 3600, 'RDV 22/07/24', '<strong>RDV T&eacute;l&eacute;phonique - PAN + TMO</strong><br />\r\n<br />\r\n<strong>Compte rendu :</strong> Financ&eacute; par l&#39;ARS - Centralisation des donn&eacute;es sant&eacute; sur un seul site internet (contacts professionnels, g&eacute;olocalisation...) - Environ 200-300 professionnels sur le territoire - Si le projet aboutis, d&#39;autres communes sont suceptible de le faire aussi. - Le projet semblait assez pr&eacute;ss&eacute;.<br />\r\n- AIPD<br />\r\n- Cartographie<br />\r\n- Plan d&#39;action', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(429, '429', NULL, 1, '2024-07-24 08:11:00', '2024-07-24 09:11:00', 102, 'AC_DEVIS', '2024-07-24 08:13:08', '2024-07-24 08:13:08', 12, NULL, NULL, 2702, 176, 0, 12, NULL, 1, 0, 'default', 0, 0, '', 3600, 'DEVIS AUDIT SITE INTERNET', '<strong>24/07/24 (TMO) :</strong> Envoyer devis au plus tard Jeudi 25 Juillet 2024 (voir avec Sophie)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(430, '430', NULL, 1, '2024-09-05 08:17:00', '2024-09-05 09:17:00', 101, 'AC_ENVOI_DOC', '2024-07-24 08:19:14', '2024-07-24 08:19:14', 12, NULL, NULL, 2703, NULL, 0, 12, NULL, 1, 0, 'default', 0, 10, '', 3600, 'PROSPECTION', 'PROSPECT TMO<br />\r\n<br />\r\n<strong>23/07/24 (TMO) :</strong> Envoi de mail &agrave; l&#39;intention de la direction - (Assistante de Direction) Accuse bonne r&eacute;ception de notre mail et le transmet au service comp&eacute;tent - Nous contacte si besoin.<br />\r\nVoir Septembre si relance', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(431, '431', NULL, 1, '2024-07-24 12:02:00', '2024-07-24 13:02:00', 5, 'AC_RDV', '2024-07-24 13:00:35', '2024-07-24 13:00:35', 12, NULL, NULL, 2704, 177, 0, 12, NULL, 1, 0, 'default', 0, 10, '', 3600, 'PROSPECTION', '<strong>PROSPECT TMO</strong><br />\r\n<strong>18/07/24 (TMO) :</strong> Mail envoy&eacute; &agrave; Mme Ghitalla.<br />\r\n<strong>24/07/24 (TMO) :</strong> Retour de Mme Ghitalla - Engag&eacute;s depuis 2 ans dans une d&eacute;marche de mise enconformit&eacute; RGPD - Mais accepte volontier un &eacute;change sur d&#39;autres offres d&#39;accompagnement propos&eacute; par notre Cabinet - Suit avec int&eacute;r&ecirc;t les publications et Webinaires d&#39;ACCENS - <span style=\"color:#c0392b\"><strong>Disponible &agrave; partir du 29 Juillet 2024.</strong></span><br />\r\nProposition de date', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL);
