(610, 'INVOICE_FREE_TEXT', 1, '<u><strong>Conditions particuli&egrave;res:</strong></u><br />\r\n<br />\r\nEn votre aimable r&egrave;glement par virement bancaire &agrave; r&eacute;ception de facture.<br />\r\n<br />\r\nConditions g&eacute;n&eacute;rales:<br />\r\n<br />\r\n<strong>MODALITES TARIFAIRES ET CONTRACTUELLES</strong><br />\r\n<br />\r\nModalit&eacute;s de facturation:<br />\r\n- Le mat&eacute;riel et les progiciels font l&lsquo;objet du versement d&rsquo;un acompte de 30% du montant de la commande &agrave; la validation de la commande. Le solde est factur&eacute; et r&eacute;glable &agrave; la livraison ;<br />\r\n- Les abonnements logiciels en mode SaaS sont factur&eacute;s du forfait total de la premi&egrave;re ann&eacute;e &agrave; la date de remise des &laquo; codes d&rsquo;acc&egrave;s &raquo; du logiciel et de pr&eacute;l&egrave;vements automatiques mensuels les ann&eacute;es suivantes.<br />\r\n- L&rsquo;assistance annuelle et l&rsquo;h&eacute;bergement sont facturables et payables &agrave; la date d&rsquo;entr&eacute;e en vigueur notifi&eacute;e sur le contrat. La date d&rsquo;entr&eacute;e en vigueur est simultan&eacute;e &agrave; la date d&rsquo;acquisition du logiciel. Elle est ind&eacute;pendante de la date de d&eacute;marrage.<br />\r\n- Les prestations de mise en oeuvre sont factur&eacute;es &agrave; prestation r&eacute;alis&eacute;e (&agrave; livraison pour les param&eacute;trages&ndash; cf. les param&eacute;trages).<br />\r\n- Les formations sont factur&eacute;es &agrave; prestation r&eacute;alis&eacute;e. - Les formations-actions sont factur&eacute;es par unit&eacute; (6h) au jour de la premi&egrave;re session quelle soit en ligne, par t&eacute;l&eacute;phone ou sur site.<br />\r\n- Annulation des prestations : une intervention annul&eacute;e du fait du client sera factur&eacute;e sur la base de 50% si l&rsquo;annulation intervient dans un d&eacute;lai inf&eacute;rieur &agrave; 7 jours calendaires et 100% si ce d&eacute;lai est inf&eacute;rieur &agrave; 48h.<br />\r\n<br />\r\nModalit&eacute;s de r&egrave;glement :<br />\r\nLes factures sont payables &agrave; r&eacute;ception de facture, par ch&egrave;que, virement ou mandat. &laquo; Si le paiement int&eacute;gral du montant de la facture n&rsquo;est pas parvenu dans le d&eacute;lai pr&eacute;vu, les sommes dues sont major&eacute;es de plein droit, et sans qu&rsquo;il soit besoin d&rsquo;une mise en demeure, d&rsquo;une p&eacute;nalit&eacute; de retard &eacute;gale &agrave; une fois et demie le taux d&rsquo;int&eacute;r&ecirc;t l&eacute;gal appliqu&eacute; au montant de la cr&eacute;ance, avec un minimum de 45 euros. En cas de non-paiement d&#39;une seule facture &agrave; son &eacute;ch&eacute;ance, MANAI SAS pourra, sans mise en demeure pr&eacute;alable, exiger le paiement imm&eacute;diat de toutes sommes lui restant dues par le Client, modifier le niveau d&#39;encours &eacute;ventuellement accord&eacute; et/ou suspendre l&#39;ex&eacute;cution de toutes commandes ou livraisons en cours. MANAI SAS se r&eacute;serve le droit de suspendre toute prestation au profit du client en cas de d&eacute;faut de paiement apr&egrave;s une mise en demeure rest&eacute;e sans effet de 15 jours. &raquo; (Extrait CGV)<br />\r\n<br />\r\nLe r&egrave;glement de cette facture confirme que le client a bien pris connaissance de l&#39;offre est subordonn&eacute;e &agrave; l&rsquo;acceptation des Conditions g&eacute;n&eacute;rales de ventes, Contrat de maintenance, et Proposition commerciale MANAI SAS', 'chaine', 0, '', '2024-01-18 11:26:38'),
