(923, 'DIGIRISKDOLIBARR_GENERAL_MEANS', 1, '<h2>Moyen de secours mis à disposition</h2><br><ul><li> - Infirmerie</li><br><li> - Nos personnels SST sont identifiés sur leurs casques et leur équipement de travail avec le badge SST</li><br><li> - Trousses à pharmacie pour les accidents bénins disponibles sur chaque sites</li></ul><br><br><h2>Consignes en cas d\'accident bénins</h2><br><ul><li> - Contacter le SST le plus proche</li><br><li> - Soin avec la trousse à pharmacie mise à disposition</li><br><li> - Déclaration sur le site :</li></ul><br><br><h2>Consignes en cas d\'accident</h2><br><ul><li> - Appel Pompiers : 18</li><br><li> - SAMU : 15</li><br><li> - Police Gendarmerie 17</li><br><li> - N&deg; de secours européen : 112</li></ul><br><br><h2>Consignes en cas d\'incendie</h2><br>En cas d\'incendie, procéder dans cet ordre :<br><ol><li> - Déclencher le signal d\'alarme.</li><br><li> - Attaquer le feu (s\'il n\'est pas trop important) avec un extincteur.</li><br><li> - Si le feu n\'est pas éteint après l\'usage d\'un seul extincteur, ou si le feu est déjà trop important, prévenir les sapeurs-pompiers.</li><br><li> - Fermer les portes et les fenêtres avant de quitter les locaux.</li><br><li> - Demander l\'aide des équipes formées.</li><br></ol>', 'chaine', 0, NULL, '2024-02-20 11:17:32'),
(924, 'DIGIRISKDOLIBARR_GENERAL_RULES', 1, '<h2>Toutes les installations</h2><br><br><p>Il est formellement interdit de fumer, de faire du feu ou d\'utiliser une flamme nue dans et sur les installations.<br />Si l\'intervention nécessite l\'utilisation d\'une flamme vive (travaux de soudage, etc.), il est impératif d\'établir un permis de feu (voir exemple en annexe 9.5).<br />D\'une manière générale, l\'accès aux installations est interdit aux personnes non autorisées.<br />Chaque intervenant doit être muni de ses titres d\'habilitation et attestations de formation. Il doit pouvoir les montrer sur site à la demande de l\'Entreprise Utilisatrice.</p><br><br><h2>Habilitations</h2><br>Toute personne intervenante doit disposer d\'une copie des habilitations suivantes :<br><ul><li> - Habilitation électrique en fonction des travaux à réaliser</li><br><li> - Attestation de formation ou habilitation aux travaux en hauteur et sauvetage en hauteur</li></ul><br>Et, être en mesure de la présenter sur simple demande de l\'Entreprise Utilisatrice, du chargé d\'intervention/de travaux ou de tout inspecteur assermenté<br><br><h2>Protections individuelles</h2><br>Toute personne intervenante doit être en mesure de disposer des Équipements de Protection Individuelle suivants selon les types de travaux effectués et les mesures de protection définies dans l\'analyse des risques.<br><br><h3>Travaux divers</h3><br><ul><li> - Casque conçu pour les travaux en hauteur (EN397) avec jugulaire et/ou satisfaisant à l\'isolement électrique (environnement électrique)</li><br><li> - Chaussures de sécurité</li><br><li> - Protections auditives, en cas de besoin</li><br><li> - Autres (à préciser) : en fonction des travaux réalisés et des risques associés.</li></ul><br><br><h3>Travaux électriques</h3><br><ul><li> - Tapis isolant ou tabouret isolant</li><br><li> - Gants adaptés au domaine de tension</li><br><li> - Casques pour travaux électrique avec écran facial (EN166)</li><br><li> - EPI réglementaires pour intervention HTA (UTE C 18-510)</li></ul><br><br><h3>Autres</h3><br>Note : Les entreprises extérieures doivent fournir à leurs intervenants les EPI désignés ci-dessus. Un tabouret et une perche se trouvent dans les postes de livraison.<br><br><h3>Travaux en hauteur</h3><br><ul><li> - EPI réglementaires (harnais, casque, 2 longes à absorbeurs ou double longe en Y, mousquetons, stop-chute, etc.) à jour de vérification</li><br><li> - Système d\'évacuation automatique :</li><br><li> - Nombre : 1 kit évacuateur (désigné pour 2 personnes)</li><li>Localisation : dans la nacelle</li><br><li> - Penser à se munir d\'un kit évacuateur supplémentaire si plus de deux personnes en nacelle</li><br><li> - Autre (à préciser) : stop-chute utilisé : HACA de référence 0529 7103 (attache en sternal sur le harnais)</li></ul><br><br>Les stop-chutes doivent être compatibles avec le système d\'assurage rigide qui équipe les machines. Les stop-chutes doivent êtres conformes à la dernière norme et avoir passés avec succès les essais complémentaires (tests additionnels CNB/P/11.073 du 13/10/2010) rendus obligatoires par l\'Avis du Ministère du Travail du 28 Septembre 2010 afin de garantir la conformité aux exigences de la directive 89/686/CEE.', 'chaine', 0, NULL, '2024-02-20 11:17:32'),
