(935, 'DIGIRISKDOLIBARR_RISKASSESSMENTDOCUMENT_METHOD', 1, '* Étape 1 : Récupération des informations<br />- Visite des locaux<br />- Récupération des données du personnel<br /><br />* Étape 2 : Définition de la méthodologie et de document<br />- Validation des fiches d\'unité de travail standard<br />- Validation de l\'arborescence des unités<br /><br />* Étape 3 : Réalisation de l\'étude de risques<br />- Sensibilisation des personnels aux risques et aux dangers<br />- Création des unités de travail avec le personnel et le ou les responsables<br />- Évaluations des risques par unités de travail avec le personnel<br /><br />* Étape 4<br />- Traitement et rédaction du document unique', 'chaine', 0, NULL, '2024-02-20 11:17:32'),
(936, 'DIGIRISKDOLIBARR_RISKASSESSMENTDOCUMENT_SOURCES', 1, 'La sensibilisation des risques est définie dans l\'ED840 édité par L\'INRS.<br />Dans ce document vous trouverez:<br />- La définition d\'un risque, d\'un danger et un schéma explicatif<br />- Les explications concernant les différentes méthodes d\'évaluation', 'chaine', 0, NULL, '2024-02-20 11:17:32'),
(937, 'DIGIRISKDOLIBARR_RISKASSESSMENTDOCUMENT_IMPORTANT_NOTES', 1, 'Notes importantes :<br />Vous pouvez lire la documentation de DigiRisk ici<br /><a href=\"https://wiki.dolibarr.org/index.php?title=Module_Digirisk\" target=\"_blank\">https://wiki.dolibarr.org/index.php?title=Module_Digirisk</a><br />Vous pouvez suivre le projet ici :<br /><a href=\"https://github.com/Evarisk/Digirisk/projects?type=classic\" target=\"_blank\">https://github.com/Evarisk/Digirisk/projects?type=classic</a><br />Reporter un bug ici<br /><a href=\"https://github.com/Evarisk/Digirisk/issues\" target=\"_blank\">https://github.com/Evarisk/Digirisk/issues</a>', 'chaine', 0, NULL, '2024-02-20 11:17:32'),
