(952, 'DIGIRISKDOLIBARR_FIRST_AID', 1, '<h2>Liste des SST présents sur site (Nom, Entreprise, Téléphone)</h2><br><br>Chaque équipe doit être constituée de manière à pouvoir dans toute circonstance prodiguer les gestes de premiers secours à n\'importe quel membre de l\'équipe.<br />Les Sauveteurs Secouristes au Travail doivent être clairement identifiés et connus de tous.<h2>Conduite à tenir en cas d\'accident</h2><br><br><h3>Accident bénin</h3><br><ul><li> - Soins prodigués par les SST</li><br><li> - Présence d\'une trousse de secours</li></ul><br><br>Chaque machine est équipée d\'au moins une trousse de secours permettent de prodiguer des soins pour des blessures légères.<br><br><h3>Accident grave</h3><br><ul><li> - Avertir le SST présent sur le site</li><br><li> - Déclencher la procédure en cas d\'urgence</li><br><li> - Informer le responsable de l\'Entreprise Utilisatrice Astreinte Exploitation 24/24h</li><br><li> - Contacter en cas d\'accident</li></ul><br><br>L\'Entreprise Utilisatrice rappelle en annexe numéros d\'urgence. <br />', 'chaine', 0, NULL, '2024-02-20 11:17:32'),
